import { Link } from "react-router-dom";
import Topbar from "./Topbar";
function Dashboard() {
  return (
    <>
      <Topbar value="Log out" link="/"></Topbar>
      <div className="container-fluid dash-container">
        <div className="row">
          <div className="col-lg-3 side-bg">
            <div className="sidebar">
              <Link to="/profile">Profile</Link>
              <Link to="/generate">URL Shortner</Link>
              <Link to="/history">Previous work</Link>
            </div>
          </div>
          <div className="col-lg-9 dash-bg">
            <div className="dash">more</div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Dashboard;
